import "./Footer.scss";
import { infoData } from "./categories";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="footer-categories info">
          <p className="category">
              {
                infoData.map({})
              }
          </p>
        </div>
        <div className="footer-categories my-page"></div>
        <div className="footer-categories product-tags"></div>
        <div className="footer-categories follow-us"></div>
      </div>
    </footer>
  );
};

export default Footer;
